import React, { useState } from "react";

function SignUpForm() {
    const [formData, setFormData] = useState({
        parentFirstName: '',
        parentLastName: '',
        parentEmail: '',
        parentPhoneNumber: '',
        kids: [{ name: '', lastName: '', age: '' }]
    });

    const handleInputChange = (e, index) => {
        const { name, value } = e.target;
        if (name.startsWith('kid')) {
            const newKids = [...formData.kids];
            newKids[index][name] = value;
            setFormData({ ...formData, kids: newKids });
        } else {
            setFormData({ ...formData, [name]: value });
        }
    };

    const handleAddKid = () => {
        setFormData({
            ...formData,
            kids: [...formData.kids, { name: '', lastName: '', age: '' }]
        });
    };

    const handleDeleteKid = (index) => {
        const newKids = [...formData.kids];
        newKids.splice(index, 1);
        setFormData({ ...formData, kids: newKids });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        // Your logic to submit the form data to the server goes here
        console.log(formData);
    };

    return (
        <div className="App">
            <h1>Sign Up Form</h1>
            <form onSubmit={handleSubmit}>
                <div>
                    <label htmlFor="parentFirstName">Parent's First Name:</label>
                    <input
                        type="text"
                        id="parentFirstName"
                        name="parentFirstName"
                        value={formData.parentFirstName}
                        onChange={handleInputChange}
                    />
                </div>
                <div>
                    <label htmlFor="parentLastName">Parent's Last Name:</label>
                    <input
                        type="text"
                        id="parentLastName"
                        name="parentLastName"
                        value={formData.parentLastName}
                        onChange={handleInputChange}
                    />
                </div>
                <div>
                    <label htmlFor="parentEmail">Parent's Email:</label>
                    <input
                        type="email"
                        id="parentEmail"
                        name="parentEmail"
                        value={formData.parentEmail}
                        onChange={handleInputChange}
                    />
                </div>
                <div>
                    <label htmlFor="parentPhoneNumber">Parent's Phone Number:</label>
                    <input
                        type="tel"
                        id="parentPhoneNumber"
                        name="parentPhoneNumber"
                        value={formData.parentPhoneNumber}
                        onChange={handleInputChange}
                    />
                </div>
                <hr />
                {formData.kids.map((kid, index) => (
                    <div key={index}>
                        <label htmlFor={`kidName${index}`}>Kid's Name:</label>
                        <input
                            type="text"
                            id={`kidName${index}`}
                            name={`kidName${index}`}
                            value={kid.name}
                            onChange={(e) => handleInputChange(e, index)}
                        />
                        <label htmlFor={`kidLastName${index}`}>Kid's Last Name:</label>
                        <input
                            type="text"
                            id={`kidLastName${index}`}
                            name={`kidLastName${index}`}
                            value={kid.lastName}
                            onChange={(e) => handleInputChange(e, index)}
                        />
                        <label htmlFor={`kidAge${index}`}>Kid's Age:</label>
                        <input
                            type="number"
                            id={`kidAge${index}`}
                            name={`kidAge${index}`}
                            value={kid.age}
                            onChange={(e) => handleInputChange(e, index)}
                        />
                        <button type="button" onClick={() => handleDeleteKid(index)}>Delete</button>
                    </div>
                ))}
                <button type="button" onClick={handleAddKid}>Add Kid</button>
                <button type="submit">Submit</button>
            </form>
        </div>
    );
}
